import React , {Component} from 'react';
import Team from './Team';


class Teamview extends Component{

    constructor(){
        super()
        this.state={
            memberinfo:[
                {img:'/images/test1.jpg', nom:'salah eddine chhoub',travail:'develppeur' ,email:'salaheddine@gamil.com' ,telephone:'0612325246' , website:'ww.tets.com'},
                {img:'/images/test1.jpg', nom:'salah eddine chhoub',travail:'develppeur' ,email:'salaheddine@gamil.com' ,telephone:'0612325246' , website:'ww.tets.com'},
                {img:'/images/test1.jpg', nom:'salah eddine chhoub',travail:'develppeur' ,email:'salaheddine@gamil.com' ,telephone:'0612325246' , website:'ww.tets.com'},
                {img:'/images/test1.jpg', nom:'salah eddine chhoub',travail:'develppeur' ,email:'salaheddine@gamil.com' ,telephone:'0612325246' , website:'ww.tets.com'}
            ]
        }
    }

    mapping(x){
     const members =   x.map( member => <Team
        key={member.img}
        nom={member.nom}
        travail={member.travail}
        email={member.email}
        telephone={member.telephone}
        website={member.website}
        />);
        return members;
    }

    render(){
        return(
            <div className='row'>
                {this.mapping(this.state.memberinfo)}
            </div>
        )
    }
}

export default Teamview;
